import React from 'react'

const AboutUs = () => {
    return (
        <div>
            <h1 className="text-3xl font-bold tracking-tight text-gray-900 sm:text-4xl"
            ><span className='text-purple-700'>Who</span> we are and our <span className='text-purple-700'>Goals</span></h1>
        </div>
    )
}

export default AboutUs;
